import Vue from "vue";
import Vuex from "vuex";
import grounding from "./grounding";
import warehouseQuery from "./warehouseQuery";

Vue.use(Vuex);
const store = new Vuex.Store({
    modules:{
        grounding,
        warehouseQuery
    }
});
export default store;
